/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `after_insert_bonuses` AFTER INSERT ON `bonuses` FOR EACH ROW BEGIN
  SET @balance = 
  (SELECT
  SUM(bonuses.quantity) 
  FROM bonuses 
  WHERE bonuses.client_id = new.client_id 
  GROUP BY client_id);
  UPDATE bonus_balance 
  SET 
    quantity = @balance
  WHERE
    client_id = new.client_id ;
