  `added_bonus` int unsigned NOT NULL DEFAULT '0' COMMENT 'Начислено бонусов',
  `sale_date` datetime DEFAULT CURRENT_TIMESTAMP,
  `shop_id` int unsigned NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `client_id` (`client_id`),
  KEY `shop_id` (`shop_id`),
  KEY `external_id` (`external_id`),
